import React, { Component } from 'react';
import "./App.css";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import {
    BrowserRouter as Router,
    Route,
    Link
  } from 'react-router-dom'
class App extends Component{
    render() {
        return(
            <Router>
            <div className="app">
                <Navbar />
                <Sidebar />
            </div> 
            </Router>
        )
    }
}

export default App;
